// ------------------ ┌∩┐(◣_◢)┌∩┐ ------------------

import React, { Component } from 'react';
import { Jumbotron } from 'reactstrap';
import TypeWriter from 'react-typewriter';

import "../basics.css";

//REDUX-o

// ------------------ ┌∩┐(◣_◢)┌∩┐ ------------------
class SingleDataField extends Component{
  constructor(props){
    super(props);



  };
// ----------------- '(◣_◢)' ------------------

// ------------------ '(◣_◢)' ------------------
  render(){


    if(this.props.type==="Basic"){
      return(

          <div className="container outline">
              <div className="row text_center outline" >
                  <div class="col-lg-11 col-centered">  
                  <p style={{textAlign:"center"}}>{this.props.name}</p>
                  </div>
              </div>
              <div className="row text_center outline" >
                  <div class="col-lg-11 col-centered">  
                  <p style={{textAlign:"center"}}>{this.props.value}</p>
                  </div>
              </div>
          </div>

      );
      }

      if(this.props.type==="Short"){
        return(

          <div className="col red-back outline">
              <div className="row-xs-6 hideOverflow" >
                  <p style={{textAlign:"left"}}>{this.props.name}</p>
              </div>
              <div className="row-xs-6 hideOverflow">
                  <p style={{textAlign:"left"}}>{this.props.value}</p>
              </div>
          </div>

        );
      }

      if(this.props.type==="Long"){
        return(
          <div className="container">
            <div className="row outline">
                  <div className="col-xs-4 hideOverflow outline" style={{textAlign:"left", width:"220px"}}>
                    <p>{this.props.name}</p>
                  </div>

                  <div className="col-lg-8 hideOverflow outline" style={{textAlign:"left"}}>
                  <TypeWriter typing={1}>{this.props.value}</TypeWriter>  
                  </div>
            </div>
          </div>

        );
      }

      if(this.props.type==="Array"){
        return(

          <div className="container outline">
                <div className="row hideOverflow outline" style={{textAlign:"center"}}>
                    <p style={{fontSize:"30px"}}>{this.props.name}</p>

                </div>

                <div className="row hideOverflow outline" style={{textAlign:"center"}}>
                    <p>{this.props.value}</p>

                </div>
          </div>

        );
      }
  }

// ------------------° ̿ ̿'''\̵͇̿̿\з=(◕_◕)=ε/̵͇̿̿/'̿'̿ ̿ °------------------
};
// ------------------° ̿ ̿'''\̵͇̿̿\з=(◕_◕)=ε/̵͇̿̿/'̿'̿ ̿ °------------------
export default SingleDataField;
